def childrenNode(node, DAG=DAG):
    l = []
    for n in DAG:
        if node in DAG[n][1]:
            l.append(n)
    return l

def childrenNodeRec(node, DAG=DAG):
    res = []
    l = childrenNode(node, DAG)
    if l != []:
        for e in l:
            if e not in res:
                res.append(e)
            else:
                del l[l.index(e)]
        for n in l:
            ll = childrenNodeRec(n, DAG)
            for e in ll:
                if e not in res:
                    res.append(e)
    return res

    

