def b_level(node, DAG=DAG, known_b_level={}):
    if node in known_b_level:
        return [known_b_level[node], known_b_level]
    else:
        l = childrenNode(node, DAG)
        if l == []:
            known_b_level[node] = DAG[node][0]
            return [DAG[node][0], known_b_level]
        else:
            max = -1
            for n in l:
                u = b_level(n, DAG, known_b_level)[0]
                if u > max:
                    max = u
            value = max + DAG[node][0]
            known_b_level[node] = value
            return [value, known_b_level]

