def t_level(node, DAG=DAG, known_t_level={}):
    if node in known_t_level:
        return [known_t_level[node], known_t_level]
    else:
        if DAG[node][1] == []:
            known_t_level[node] = 0
            return [0, known_t_level]
        else:
            max = -1
            for n in DAG[node][1]:
                u = t_level(n, DAG)[0] + DAG[n][0]
                if u > max:
                    max = u
            known_t_level[node] = max
            return [max, known_t_level]

