def CPN_Gen(DAG=DAG, known_b_level={}):
    CPN = []
    for node in DAG:
        if not(node in known_b_level):
            u = b_level(node, DAG, known_b_level)
    n = None
    m = 0
    for node in known_b_level:
        a = known_b_level[node]
        if a > m:
            n = node
            m = a
    CPN.append(n)
    l = childrenNode(CPN[-1], DAG)
    while l != []:
        n = None
        m = 0
        for node in l:
            a = known_b_level[node]
            if a > m:
                n = node
                m = a
        CPN.append(n)
        l = childrenNode(CPN[-1], DAG)
    return CPN

