def includeAncestors(node, list, DAG=DAG):
    l = []
    known_b_level = {}
    known_t_level = {}
    for n in DAG[node][1]:
        if not(n in list):
            l.append([n, b_level(n, DAG, known_b_level)[0]])
    if l == []:
        list.append(node)
    else:
        while l != []:
            i = 0
            m = 0
            for j in range(0, len(l)):
                if l[j][1]>m:
                    i = j
                    m = l[j][1]
                elif l[j][1] == m and t_level(l[j][0], DAG, known_t_level)[0]<t_level(l[i][0], DAG, known_t_level)[0]:
                    i = j
            includeAncestors(l[i][0], list, DAG)
            del l[i]
        list.append(node)

def includeOBNs(list, DAG=DAG):
    OBN = []
    for node in DAG:
        if not(node in list):
            OBN.append([node, b_level(node, DAG)[0]])
    while OBN != []:
        i = 0
        m = 0
        for j in range(0, len(OBN)):
            if OBN[j][1]>m:
                i = j
                m = OBN[j][1]
        list.append(OBN[i][0])
        del OBN[i]

def CPN_Dom_Gen(CPN, DAG=DAG):
    l = []
    for node in CPN:
        if l == []:
            l.append(node)
        else:
            includeAncestors(node, l, DAG)
    includeOBNs(l, DAG)
    return l

