                ii = i_proc[0][i] #indice du proc
                j = i_proc[1][i] #indice du parent dans le proc
                if j != -1: #si le proc n'est pas vide, on a dit insert = -1 si il est vide
                    while a and j < len(proc[ii][0])-1: #tant qu'on n'a pas trouv (a) et qu'on est pas all  l'avant-dernier lment (j)
                        #if i_proc[1][j+1] == -1: #le proc d'aprs est vide
                        #    d = -1
                        #else: #il l'est pas
                        d = proc[ii][1][j+1]-proc[ii][1][j]-proc[ii][2][j]
                        if d >= DAG[n][0] and (tmin == -1 or proc[ii][1][j] + proc[ii][2][j] <= tmin) and proc[ii][1][j] + proc[ii][2][j] >= t: #sinon si on est  l'intrieur + l'cart est le bon et est bien aprs tmin
                            tmin = proc[ii][1][j] + proc[ii][2][j]
                            indice = ii
                            insert =  j + 1
                            a = False
                        j += 1
                    if a and (proc[ii][1][-1] + proc[ii][2][-1] <= tmin or tmin == -1): #dernier element
                        indice = ii
