def BlockingNodesList(CPN, DAG=DAG):
    l = []
    for n in DAG:
        if not(n in CPN):
            l.append(n)
    return l

def ScheduleLength(schedule):
    max = 0
    for p in schedule:
        if p[0]!=[]:
            a = p[1][-1]+p[2][-1]
            if a>max:
                max = a
    return max

