def jump(node, proc, schedule, DAG=DAG):
    l = childrenNodeRec(node, DAG)
    ##print(l)
    t = 0
    i_n = -1
    j_n = -1
    for i in range(0, len(schedule)):
        for j in range(0, len(schedule[i][0])):
            d = schedule[i][1][j]+schedule[i][2][j]
            if schedule[i][0][j] in DAG[node][1] and d>t:
                t = d
            if schedule[i][0][j] == node:
                i_n = i
                j_n = j
    insert = -1
    u = schedule[i_n][1][j_n]
    if proc[0] == []:
        proc[0].append(node)
        proc[1].append(0)
        proc[2].append(DAG[node][0])
        del schedule[i_n][0][j_n]
        del schedule[i_n][1][j_n]
        del schedule[i_n][2][j_n]
        [deltalist, lmodlist] = DecaleTout(node, schedule, DAG[node][0], DAG)
    else:
        j = 0
        tinsert = -1
        a = True
        length = len(proc[0])-1
        while j < length:
            if proc[0][j] in l:
                a = False
                if j!=0:
                    tinsert = max(proc[1][j-1]+proc[2][j-1], t)
                    insert = j
                else:
                    tinsert = 0
                    insert = 0
                break
            else:
                d = proc[1][j+1]-proc[1][j]-proc[2][j]
                if proc[1][j]+proc[2][j] <= t and proc[1][j+1] - t >= DAG[node][0]:
                    tinsert = t
                    break
                elif proc[1][j]+proc[2][j] >= t and d >= DAG[node][0]:
                    tinsert = proc[1][j]+proc[2][j]
                    break
            j += 1
        if tinsert == -1:
            if proc[0][-1] in l:
                if len(proc[1]) > 1:
                    tinsert = max(proc[1][-2]+proc[2][-2], t)
                else:
                    tinsert = max(0, t)
                a = False
                insert = len(proc[1])-1
            else:
                tinsert = proc[1][-1]+proc[2][-1]
        if a:
            insert = j+1
        del schedule[i_n][0][j_n]
        del schedule[i_n][1][j_n]
        del schedule[i_n][2][j_n]
        proc[0].insert(insert, node)
        proc[1].insert(insert, tinsert)
        proc[2].insert(insert, DAG[node][0])
        # print("jump")
        # print(insert)
        #print('temps')
        #print(tinsert + DAG[node][0])
        #print(schedule)
        [deltalist, lmodlist] = DecaleTout(node, schedule, tinsert+DAG[node][0], DAG)
    return [i_n, j_n, insert, u, deltalist, lmodlist]


def FAST(MAXSTEP, MAXCOUNT, MARGIN, p, DAG=DAG, CPN=[], NewSchedule=[], BN=[]):
    if CPN==[]:
        CPN = CPN_Gen(DAG)
    if NewSchedule == []:
        NewSchedule = InitialSchedule(p, DAG, CPN)
    if BN == []:
        BN = BlockingNodesList(CPN, DAG)
    BestSL = -1
    searchcount = 0
    while searchcount <= MAXCOUNT:
        searchstep = 0
        counter = 0
        a = True
        while a:
            n = random.choice(BN)
            # print('premier')
            # print(n)
            # print(NewSchedule)
            p = random.choice(NewSchedule)
            proci = -1
            for i in range(0, len(NewSchedule)):
                if n in NewSchedule[i][0]:
                    proci = i
            while True:
                p = random.choice(NewSchedule)
                if NewSchedule.index(p) != proci:
                    break
            # print(p)
            SLavant = ScheduleLength(NewSchedule)
            [i_n, j_n, insert, u, deltalist, lmodlist] = jump(n, p, NewSchedule, DAG)
            SLapres = ScheduleLength(NewSchedule)
            if SLapres >= SLavant:
                # print('echec')
                # print(NewSchedule)
                DecaleInverse(NewSchedule, deltalist, lmodlist)
                ##print("begin")
                #print(NewSchedule)
                NewSchedule[i_n][0].insert(j_n, n)
                NewSchedule[i_n][1].insert(j_n, u)
                NewSchedule[i_n][2].insert(j_n, DAG[n][0])
                del p[0][insert]
                del p[1][insert]
                del p[2][insert]
                # print(insert)
                # print(NewSchedule)
                # print("end")
                counter += 1
            else:
                counter = 0   
            searchstep += 1
            if searchstep >= MAXSTEP or counter >= MARGIN:
                a = False
            # print("end premier")
        SL = ScheduleLength(NewSchedule)
        if BestSL > SL or BestSL == -1:
            BestSchedule = NewSchedule
            BestSL = SL
        n = random.choice(CPN)
        proci = -1
        for i in range(0, len(NewSchedule)):
            if n in NewSchedule[i][0]:
                proci = i
        while True:
            p = random.choice(NewSchedule)
            if NewSchedule.index(p) != proci:
                break
        # print('deuxieme')
        # print(n)
        # print(p)
        # print(NewSchedule)
        [i_n, j_n, insert, u, deltalist, lmodlist] = jump(n, p, NewSchedule, DAG)
        searchcount += 1
        # print(NewSchedule)
        # print("end deuxieme")
    return BestSchedule, searchcount

